        <text>El Objeto Game lo consigo luego de obtener el id_game.

Puedo cancelar un juego (cuando sea)
InitGame() inicia un juego con un usuario y la posicion de los barcos.
Cuando los dos iniciaron arranca el juego. 
El tablero tendria que saber si se iniciò o no.
Move() es un movimiento. Verifica que no haya un barco, sino lo hunde.
Tambien deberìa saber quien fue el ultimo movimiento
board_user() -&gt; El user tendria que saber cual es su tablero.
(podria saber donde tiro tambien tablero session)
